import React from 'react';
import {connect} from "react-redux";
import {UpdateStatusFalse, UpdateStatusTrue} from "../../../../../redux/inputTextReducer";
import InputSelect from "./input_select";

let mapStateToProps=(state)=>{
    return{
        addressPage:state.Address
    }

}
const InputSelectContainerExport = connect(mapStateToProps,{UpdateStatusTrue,UpdateStatusFalse})(InputSelect);
export default InputSelectContainerExport;
